import './Projects.css';

const Projects = () => {

    return (
    <section className="projects">
        <div className="carousel">
            <h2>Projects</h2>
            <div className="project-card">
                <h3>project 1</h3>
                <p>description</p>
            </div>
            <div className="project-card">
                <h3>project 2</h3>
                <p>description</p>
            </div>
            <div className="project-card">
                <h3>project 3</h3>
                <p>description</p>
            </div>
        </div>
    </section>
);
};
export default Projects;
